import "./footer.css";

import React from "react";
import { Link } from "react-router";
import { connect } from "react-redux";

export const footer = ({}) => {
  return (
    <nav className="navbar">
      <ul className="navbar-nav">
        <li>
          <Link to={"/products"} className="nav-link">
            Search Products{" "}
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default footer;
